import { styled } from '@mui/system'
import { Box,InputAdornment,Paper, Stack,TextField,Typography} from '@mui/material'
import React from 'react'
import Theme from '../../Component/Theme'; //**** Special import*/
import {ThemeProvider} from '@mui/material';
import img1 from '/media/nipuna/SSD FILES/FinalProject/FrontEnd/medi-ward-sri-lanka/src/Assest/mainlogo.png'
import PersonIcon from '@mui/icons-material/Person';

const theme=Theme();

const DemoPaper = styled(Paper)(({ theme }) => ({

    width: 1000,
    height:800,
    textAlign: 'center',
    borderRadius:theme.shape.borderRadius*6
  }));

const UserTitleBox=styled(Stack)(({theme})=>({
    width:"100%",
    paddingLeft:"100px",
    paddingRight:"100px",
    textAlign:"center",

}))

const UserText=styled(Box)(({theme})=>({
    marginTop:"7px",
    marginBottom:"7px",
    //marginRight:"3px",
    //marginLeft:"3px",
    textAlign:"left",
    width:"100%",
}))

const UserInputBox=styled(Box)(({theme})=>({

    marginTop:"7px",
    marginBottom:"7px",
    //marginRight:"3px",
    //marginLeft:"3px",
    textAlign:"left",
    width:"100%",
}))



const Login = () => {

  return (
    <ThemeProvider theme={theme}>
        <Stack bgcolor="white" display="flex" direction="row" justifyContent="center"  alignItems="center" sx={{
            marginTop:6,
            marginBottom:6,
        }}>
            <DemoPaper elevation={6}>
                <Stack display="flex" direction="row" justifyContent="space-between">
                    <Box flex="40%" sx={{
                        display:"flex",
                        justifyContent:"center",
                        alignItems:"center",
                        backgroundColor:theme.palette.primary.dark,
                        height:800,
                        borderTopLeftRadius:theme.shape.borderRadius*6,
                        borderBottomLeftRadius:theme.shape.borderRadius*6
                    }}>
                        <img src={img1} alt='Main_Logo' width="400px" height="400px"></img>
                    </Box>
                    <Stack flex="55%" sx={{ 
                        height:800,
                        borderTopRightRadius:theme.shape.borderRadius*6,
                        borderBottomRightRadius:theme.shape.borderRadius*6,
                        display:"flex",
                        direction:"column",
                        alignItems:"center",
                    }}><Stack sx={{
                        display:"flex",
                        direction:"column",
                        alignItems:"center",

                    }}>
                        <UserTitleBox>
                            <Typography variant="h3">Welcome!</Typography>
                        </UserTitleBox>
                        <UserText>
                            <Typography variant='h6'>Username</Typography>
                        </UserText>
                        <UserInputBox>
                            <TextField id="outlined-basic" variant="outlined" placeholder="Enter your username" size='small'sx={{
                                placeholder:"Enter your username",
                                 size:'small',
                                 width:"100%"
                            }}
                            inputProps={{
                                endAdornment:<InputAdornment position="end"><PersonIcon></PersonIcon></InputAdornment>
                            }}
                            />
                        </UserInputBox>


                    </Stack>




                    </Stack>
                </Stack>

            </DemoPaper>
        </Stack>
    </ThemeProvider>
  )
}

export default Login
